import { SafeAreaView } from 'react-native'
import styled from 'styled-components/native'

const StyledText = styled.Text`
    color: red;
`
const História = () => {
  return (
    <SafeAreaView>
      <StyledText>História</StyledText>
    </SafeAreaView>
  )
}

export default História
